import React from "react";
import imageMyAcc from "../../../assets/hero.svg    ";
const MyAccount = () => {
  return (
    <div id="myAcc">
      <img src={imageMyAcc} alt="" />
      <div className="container">
        <div className="myAcc"></div>
      </div>
    </div>
  );
};

export default MyAccount;
